import React from "react";
import { connect } from "react-redux";

const Alert = ({ alerts }) => {
  console.log(alerts);
  alerts !== null &&
    alerts.length > 0 &&
    alerts.map(alert => {
      return (
        <div key={alert.id} style={{ fontSize: 50, color: "red" }}>
          hello
          {alert.msg}
        </div>
      );
    });
};

const mapStateToProps = state => ({
  alerts: state.Authenticate.errors
});

export default connect(mapStateToProps)(Alert);
